import Dropdown from "../commonwallpaper/Dropdown";
import "./SignUp.scss";
import SignUpBody from "./SignUpBody";

function SignUp() {
  return (
    <div>
      <div
        className="flex justify-centre items-center h-full bg-black bg-opacity-100 overflow-hidden"
        style={{ backgroundColor: "#000" }}
      >


        <div>
          <Wallpaper />
        </div>
        <div class="absolute">
          {" "}
